import { Navigate } from 'react-router-dom';
import { AuthGoogleContext } from '../../contexts/authGoogle'

export const Home = () => {
    const { user, signOut } = useContext(AuthGoogleContext)

    return (
        <div>
            <button onClick={() => signOut()}>Sair</button>
            <h1>{user}</h1>
        </div>
    )

}
